import React, { FC } from 'react';

type HeaderProps = {
  title: string,
  paragraph: string
}

export const Header: FC<HeaderProps> = ({ title, paragraph }) => {
    return (
        <>
            <h2>{ title }</h2>
            <p>
                { paragraph }
            </p>
        </>
    )};
